import instanse from "./index";

export const userApi = {
  signup: async (payload) => {
    return await instanse.post("/users/signup", { ...payload });
  },

  login: async(payload) =>{
    return await instanse.post("/users/login", { ...payload })
  },

  renewToken:async (payload) =>{
    return await instanse.post("/users/renewAcessToken", { ...payload })
  },

  logout: async() => {
    return await instanse.patch("/users/logout")
  },

  getMe: async() => {
    const data = await instanse.get("/users/me").then((respose) => respose)
    debugger
    return  data
  },

  userUpdate: async(payload) =>{
    return await instanse.patch("/users/update", { ...payload }).then((respose) => respose)
  },

  userDelete: async() => {
    return await instanse.delete("/users/delete").then((respose) => respose)
  },
};
